function r = ExtractOOIs(depth)
    r.N = [];
    r.leftEdges = [];
    r.rightEdges   = [];
    
    left_edge = zeros(120,160);
    right_edge = zeros(120,160);
    N = zeros(120,1);
    N(:) = 1;
    depthLevel[10];
        
    for i = 1:120
        depthCounter = 1;
        depthLevel(:) = 1;
        maxdepthLevel = 1;
        for j = 1:159
            if depth(i,j) > 1000 && depth(i, j+1) <= 1000 && depthCounter == 0
                left_edge(i,N(i)) = j+1;
                depthLevel(depthCounter) = depth(i, j+1);
                depthCounter = depthCounter + 1;
            elseif depthCounter ~= 0 && depth(i,j+1) < depthLevel(depthCounter)
                N(i) = N(i) + 1;
                left_edge(i,N(i)) = j+1;
                depthLevel(depthCounter) = depth(i,j+1);
                if depthLevel(depthCounter) < 
                depthCounter = depthCounter + 1;
            elseif depth(i,j) <= 1000 && depth(i, j+1) > 1000
                right_edge(i,N(i)) = j;
                N(i) = N(i) + 1;
            end
        end
    end
    N(:) = N(:) - 1;
    maximum = max(N);
    
    OOI_left_edge = zeros(120,maximum);
    OOI_right_edge = zeros(120,maximum);
    OOI_N = zeros(120,1);
    OOI_N(:) = 1;
    
    for i = 1:120
        for j = 1:N(i)
            distance = right_edge(i,j)-left_edge(i,j);
            if distance >= 30 && distance <= 500
                OOI_left_edge(i,OOI_N(i)) = left_edge(i,j);
                OOI_right_edge(i,OOI_N(i)) = right_edge(i,j);
                OOI_N(i) = OOI_N(i) + 1;
            end
        end
    end
    
    OOI_N(:) = OOI_N(:) - 1;
    
    r.N = OOI_N;
    r.leftEdges = OOI_left_edge;
    r.rightEdges = OOI_right_edge;
    
return;
end
    
function PlotOOIs(OOIs, depth, frame, mh)
    X = linspace(1,160,1);
    Y = linspace(1,120,1);
    % and then refresh the data in the plots...

    set(mh.handle1, 'xdata', X, 'ydata', Y, 'zdata', depth(Y,X));
        
    %set(mh.handle2, 'xdata', OOIs.leftEdges, 'ydata', Y, 'zdata', depth(Y,OOIs.leftEdges));
    %set(mh.handle3, 'xdata', OOIs.rightEdges, 'ydata', Y, 'zdata', depth(Y,OOIs.rightEdges));
    % and some text...
    s = sprintf('3D Camera Frame # [%d]',frame);
    set(mh.handle4,'string',s);
return;
end